	('5da8f4ef8303b310c1d6e63c', '5da8f4ef8303b310c1d6e63c', 886, 105, 1123, 'This ticket was donated to the Historical Society in 1998 by Frank Farwell, who attended the event as a young boy. It was probably torn when the ticketholder entered the gates. The Farwells attended Game 3 and sat in section 7, paying $1.10 per ticket.', 4, ''),
	('5da8f4ef8303b310c1d6e63d', '5da8f4ef8303b310c1d6e63d', 887, 105, 1124, 'The map drawn on the reverse side of the ticket shows how the field and grandstands were set up in relation to Green Bay Road and the Onwentsia clubhouse. Handwriting indicates that Mr. Farwell “went with Bill & my family.”', 5, ''),
	('5da8f4ef8303b310c1d6e63f', '5da8f4ef8303b310c1d6e63f', 888, 105, 1125, 'Chicago Tribune, August 1933.', 7, ''),
	('5da8f4ef8303b310c1d6e641', '5da8f4ef8303b310c1d6e641', 889, 105, 1126, 'The series received in-depth attention from newspapers all over the country, especially on the East Coast. The West victory in Game 3 dominated the headlines of the August 21, 1933 Chicago Daily Tribune.', 9, ''),
