	('5db7d7f2eb24173a5bf153a6', '5db7d7f2eb24173a5bf153a6', 904, 106, 1148, 'In September 1956, Knollwood played host to the 56th U.S. Men’s Amateur. Harve Ward won the tournament, defeating Ken Venturi in early rounds of match play and Charles Kocsis for the title. Pictured are Kocsis (putting) and Ward (looking on at left) during the second 18 holes of the final match.', 7, ''),
