	('5db7da48eb24173a5bf153b6', '5db7da48eb24173a5bf153b6', 908, 107, 1152, 'Over 200 golfers waited up to half an hour to try out the new golf course, then called Rockland Park, on its Preview Day, August 30, 1968. The course opened eight months ahead of schedule and cost $2,400 less than expected. Lake Forester, September 5, 1968.', 0, ''),
